const handleClick = () => {
    setChosenAnwserItems((prevState) => [...prevState, question.text])
}

    return(
        <button
            className="question-block"
            onClick={handleClick}
        >
            <img src={question.image}/>
            <h3>{question.text}</h3>
            <p>
                <a href={question.url}>{ question.credit}</a>
                <a href="https://wwww.unsplash.com">unsplash</a>
            </p>

        </button>
    )
}

